import React from "react";

import Footer from "../Footer/Foot";
import Products from "../Products.jsx/Products";
import ProductData from "../Data/ProductData";
import Form from "react-bootstrap/Form";

function Cars() {
  const productElement = ProductData.map((item) => {
    return (
      <Products
        key={item.id}
        img={item.img}
        price={item.price}
        engine={item.engine}
        fuel={item.fuel}
        hspwr={item.horsepower}
        mileage={item.mileage}
      />
    );
  });
  return (
    <>
      <div className="container pt-5">
        <div className="row">
          <div className="col-md-3" style={{ backgroundColor: "grey" }}>
            <Form>
              <Form.Group className="m-3">
                <Form.Label>Model</Form.Label>
                <Form.Control type="text" placeholder="Enter Model" />
              </Form.Group>
            </Form>
            <hr className="mt-3 mb-" />
          </div>
          <div
            className="col-md-8 offset-md-1"
            style={{ backgroundColor: "grey" }}
          >
            <div
              className="row justify-content-center"
              style={{ maxWidth: "1300px" }}
            >
              {productElement}
            </div>
          </div>
        </div>
      </div>

      <div className="container-fluid d-flex justify-content-center">
        <div className="row mt-4 p-3" style={{ maxWidth: "1300px" }}>
          {productElement}
          <Footer />
        </div>
      </div>
    </>
  );
}
export default Cars;
